def transform(sequence):
    zeros_count = 0
    nines_count = 0
    middle_part = ""

    for i in range(len(sequence)):
        if sequence[i] == '0':
            zeros_count += 1
        elif sequence[i] == '9':
            nines_count += 1
        else:
            middle_part += sequence[i]

    transformed_sequence = '0' * zeros_count + middle_part + '9' * nines_count

    return transformed_sequence

